import React, { Component } from 'react';
import {Row,Col } from 'react-bootstrap';
import Api from '../Api';


class InfoRight extends Component {
    constructor(props) {
        super(props);
        this.state = {
            content: [],
        }
      }

     

  render() {
    return (
        <div>
            <Row className="row is-flex account-info-general">
                <Col lg={5}>
                    <ul  id="account-info">
                        <li><strong>Personal Profile</strong> | <a href="/ajustAccount">EDIT</a></li>
                        <hr></hr>
                        Info Customer will be here
                                    <li><a href="#">My Profile</a> </li>
                                    <li><a href="#">My Order</a> </li>
                                    <li><a href="#">Address Book</a> </li>
                    </ul>
                </Col>
                <Col lg={7}>
                    <ul id="account-shipping">
                        <li><strong>Address Book</strong></li><hr/>
                    </ul>

                </Col>
            </Row>
        </div>
    );
  }
}

export default InfoRight;
